REPLACE INTO `creature_text` (`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `SoundPlayType`, `BroadcastTextId`, `TextRange`, `comment`) VALUES (707018, 0, 7, 'Are we in space yet? What\'s the hold-up? Gotta go to space. Gotta go to SPACE.', 14, 0, 0, 0, 0, 0, 0, 0, 0, '');
